import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class EmplyoeeService {

  constructor() { }

  getEmplyoees(){
    return [
      {'id':1,'name':'karthick','age':23},
      {'id':2,'name':'javith','age':25},
      {'id':3,'name':'nithesh','age':30}
    ];
  }
}
